        public static List<Thread> listOfThreads = new List<Thread>();
        public static Thread finalThread = new Thread(() =>
        {
            while (true)
            {
                bool threadsAreAlive = false;
                foreach (Thread T in GenerateData.listOfThreads)
                {
                    if (T.IsAlive) threadsAreAlive = true;
                }
                if (!threadsAreAlive)
                {
                    StoredData.Serialize();
                    break;
                }
            }
            FormMessageBoxOK X = new FormMessageBoxOK("Information", "Les listes par défaults ont été appliquer\nUn redémarrage est necessaire", true);
            X.StartPosition = FormStartPosition.CenterParent;
            X.ShowDialog();
            if(X.DialogResult == DialogResult.OK)
            {
                Process.GetCurrentProcess().Kill();
            }
        });

